import './index.css';

function Header() {
    return (
        <div className='wrap'>
            <div className='mypic'>
                <h1 className='mypicTitle'>백예린 팬명록</h1>
                <p className='mypicTemp'>현재 기온: <span id="temp">18.57</span>도</p>
                <button className='posting-box'>POSTING BOX</button>
            </div>
        </div>
    )
}

export default Header
